import React from "react";

const FilterByName = (props) => {
  const handleChange = (event) => {
    props.handleFilter({
      value: event.target.value,
      key: "specie",
    });
  };

  return (
    <>
      <label htmlFor="specie">Filtrar por especie</label>
      <input
        type="text"
        // value={props.name}
        name="specie"
        id="specie"
        onChange={handleChange}
      />
    </>
  );
};
export default FilterByName;
